import React, { useState } from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Stack from "@mui/material/Stack";
import Button, { ButtonProps } from "@mui/material/Button";
import FormGroup from "@mui/material/FormGroup";
import { styled, alpha } from "@mui/material/styles";
import InputBase from "@mui/material/InputBase";

// MUI Button Styles
const ColorButton = styled(Button)<ButtonProps>(({ theme }) => ({
  color: theme.palette.getContrastText("#2F49D1"),
  backgroundColor: "#2F49D1",
  "&:hover": {
    backgroundColor: "#2F49D1",
  },
  textTransform: "none",
}));

export default function Signup() {
  const [usernameReg, setUsernameReg] = useState("");
  const [passwordReg, setPasswordReg] = useState("");

  return (
    <section className="c-signup">
      <div className="c-signup__card">
        <FormGroup>
          <Box
            component="form"
            sx={{
              "& > :not(style)": { m: 1, width: "45ch" },
            }}
            noValidate
            autoComplete="off"
            className="c-signup__card__form"
          >
            {/* Username Input */}
            <label className="c-signup__card__form__input">
              <span>Username</span>

              <TextField
                id="outlined-basic"
                variant="outlined"
                placeholder="Enter your username"
                onChange={(e) => {
                  setUsernameReg(e.target.value);
                }}
              />
            </label>

            {/* Password Input */}
            <label className="c-signup__card__form__input">
              <span>Password</span>

              <TextField
                variant="outlined"
                placeholder="Enter your password"
                onChange={(e) => {
                  setUsernameReg(e.target.value);
                }}
              />
            </label>

            {/* Password Confirmation Input */}
            <label className="c-signup__card__form__input">
              <span>Confirm Password</span>

              <TextField
                variant="outlined"
                placeholder="Confirm your password"
              />
            </label>

            <Stack direction="column">
              <ColorButton variant="contained">Sign Up</ColorButton>
            </Stack>
          </Box>
        </FormGroup>
      </div>
    </section>
  );
}
